import React, { useState } from 'react';
import StudentRow from './StudentRow';
import Button from '@mui/material/Button';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';

const DashboardTable = () => {
    const [students, setStudents] = useState([{ id: 1, name: 'Claire', files: [] }]);

    const addStudent = () => {
        const newStudent = {
            id: students.length + 1,
            name: `Student ${students.length + 1}`,
            files: []
        };
        setStudents(students.concat(newStudent));
    };

    return (
        <div>
            <Button variant="contained" onClick={addStudent} style={{ marginBottom: '20px' }}>Add Student</Button>
            <Table>
                <TableHead>
                    <TableRow>
                        <TableCell>Student Name</TableCell>
                        <TableCell>Item</TableCell>
                        <TableCell>Date</TableCell>
                        <TableCell>Rec</TableCell>
                        <TableCell>Action</TableCell>
                        <TableCell>Other</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {students.map((student) => (
                        <StudentRow key={student.id} student={student} />
                    ))}
                </TableBody>
            </Table>
        </div>
    );
};

export default DashboardTable;
